import React from 'react';
import { useHistory } from 'react-router-dom';

const LoginScreen = () => {
  const history = useHistory();

  const handleUserLogin = () => {
    history.push('/user-profile');
  };

  const handleClinicianLogin = () => {
    history.push('/clinician-profile');
  };

  return (
    <div>
      <h1>Login</h1>
      <div>
        <h2>User Login</h2>
        {/* Form inputs and submit button for user login */}
        <button onClick={handleUserLogin}>Login as User</button>
      </div>
      <div>
        <h2>Clinician Login</h2>
        {/* Form inputs and submit button for clinician login */}
        <button onClick={handleClinicianLogin}>Login as Clinician</button>
      </div>
    </div>
  );
};

export default LoginScreen;
